import React from 'react';
import Blog_bg from '../../images/blogs-bg.jpg';

export default function Blogs() {
    return (
        <div style={{
            background: `url(${Blog_bg}) no-repeat center`,
            width: "100%",
            backgroundSize: "cover"
        }}>
            <p></p>
        </div>
    )
}
